import React from 'react'
import { Row, Col, Container } from 'react-bootstrap'

export const HomePage = () => {
    return (
        <Row style={{ height: '90vh' }} class='d-flex justify-content-center aling-items-center'>
            <Col style={ styles.col } className='d-flex justify-content-center'>
                <Container>
                    <div style={{ textAlign: 'center' }}>
                        <h4>Pendientes</h4>
                    </div>
                </Container>
            </Col>
            <Col style={ styles.col } className='d-flex justify-content-center'>2 of 3</Col>
            <Col style={ styles.col } className='d-flex justify-content-center'>3 of 3</Col>
        </Row>
    )
}







const styles = {
    col: {
        backgroundColor: 'white',
        borderRadius: '5px',
        minHeigth: '85vh',
        margin: '10px',
        overflowY: 'scroll'
    }
}
